create table spells_states
(
    Id                 int          not null
        primary key,
    Name               varchar(255) null,
    NameId             int unsigned not null,
    PreventsSpellCast  tinyint      not null,
    PreventsFight      tinyint      not null,
    IsSilent           tinyint      not null,
    CantDealDamage     tinyint      not null,
    Invulnerable       tinyint      not null,
    Incurable          tinyint      not null,
    CantBeMoved        tinyint      not null,
    CantBePushed       tinyint      not null,
    CantSwitchPosition tinyint      not null,
    InvulnerableMelee  tinyint      not null,
    InvulnerableRange  tinyint      not null
)
    engine = MyISAM
    charset = utf8;

